import logo from './logo.svg';
import './App.css';
import { App } from './App.1';
export const user = {
  name: 'Hedy Lamarr',
  imageUrl: 'https://i.imgur.com/yXOvdOSs.jpg',
  imageSize: 90,
};
export const products = [
  { title: 'Cabbage', id: 1 },
  { title: 'Garlic', id: 2 },
  { title: 'Apple', id: 3 },
];
function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

export default App;
